    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Red Rock Lakes NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Red Rock Lakes NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, and information about the management direction. Key planning issues include:
    wildlife management, habitat management, and visitor services.",nt"owner_org":
